class Dashboard extends Component{
    state={
        charts:{
            title:'name',
            date:'01-08-2020',
            data:[1,2,3,4,5],
        }
    }

    render(){
        return(
            <div style={styles.container}>
                <DashboardNav/>
                <section style={styles.content}>
                    <SearchBar/>
                    <div style={styles.content}>
                        <h1>Dashboard</h1>
                        <Charts/>
                     </div>
                </section>
            </div>
            // search box
            // content
        )
    }

}

export default Dashboard;

const styles ={
    container:{
        color:'red',
        display:'flex',
        backgroundColor:'black',
